import styled from 'styled-components';

export const Nav=styled.div`
background-color: #cd0000;
width:200px;
.btn{
    width:100px;
    margin:20px auto;
}
`
export const NavItem=styled.div`
display: block;
margin: 0 10px;
padding: 9px 10px;
border-bottom: 1px solid #b70000;
border-top: 1px solid #de3636;
color: #fff;
`
